/**
 *
 * Footer.js
 * @author Peter Laxalt
 * @description The website footer.
 *
 */

// Core
import React from "react";

// Styles
import { FooterClassName, FooterStyle } from "./styles.scss";

// Begin Component
//////////////////////////////////////////////////////////////////////

export const Footer = () => {
  return (
    <FooterStyle className={`${FooterClassName}`}>
      <div className={`${FooterClassName}__inner`}></div>
    </FooterStyle>
  );
};

// End Component
